function Model(){var n=this;n.loaded=ko.observable(!0);n.balance={balance:ko.observable(0),returnAddress:ko.observable("")};n.address=ko.observable();n.transactionId=ko.observable();n.inProgress=ko.observable(!1);n.disableSubmit=ko.computed(function(){return n.inProgress()||$.trim(n.address()).length!=34});n.confirmation=ko.observable(0);$.getJSON("api/Faucet/GetBalance").done(function(t){n.balance.balance(t.balance);n.balance.returnAddress(t.returnAddress);n.loaded(!0)});n.onSendClick=function(){n.inProgress(!0);$.ajax({url:"api/Faucet/SendCoin",method:"POST",data:JSON.stringify({address:n.address()}),dataType:"json",contentType:"application/json; charset=utf-8"}).done(function(t){n.transactionId(t.transactionId);n.address("")}).always(function(){n.inProgress(!1)})}}ko.punches.enableAll();var model=new Model;ko.applyBindings(model);